    data: |
      SELECT DISTINCT + col1 * - col2 AS col0 FROM tab0 (FORMAT parquet) WHERE - 17 NOT BETWEEN 95 AND - - col1;
  - name: tab0

outputs:
  - name: q9510.out
    data: |
      -210
      -3807
      -99
